let date,jobSection=document.getElementsByClassName("job-post"),endDate=document.getElementsByClassName("endDate"),today=new Date;function formatDate(){for(let e=0;e<endDate.length;e++){let t=endDate[e].textContent.trim().replace("End Date:","").trim();if("NA"!==t){let a=t.split("-"),n=`${a[2]}-${a[1]}-${a[0]}`;date=new Date(n),isNaN(date.getTime())||today.getTime()>date.getTime()&&jobSection[e].remove()}}}window.addEventListener("load",formatDate);